import React from "react";

const ParamCompo = ({ match }) => {
  const { name, age, addr } = match.params;
  return (
    <div className="ParamCompo">
      <h4>ParamCompo</h4>
      <p>
        이름 :{name} <br />
        나이 :{age} <br />
        주소 :{addr} <br />
      </p>
    </div>
  );
};

export default ParamCompo;
